INSERT INTO `book` VALUES (1,'The Great Gatsby','The story of Jay Gatsby, a young millionaire who tries to win back his lost love while navigating the excesses and decadence of the roaring twenties.','693067420-6',377,'2022-05-11',22,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (2,'To Kill a Mockingbird','Set in the South during the 1930s, this novel explores themes of racial injustice and the loss of innocence through the eyes of young Scout Finch.','021591111-3',310,'2023-01-06',2,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (3,'The Catcher in the Rye','The story of Holden Caulfield, a teenage boy who is expelled from his prep school and wanders around New York City, struggling to come to terms with the adult world.','682690891-3',150,'2023-03-02',23,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (4,'1984','A dystopian novel set in a future totalitarian society where the government controls every aspect of citizens'' lives and even their thoughts.','893578354-4',498,'2022-10-14',10,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (5,'Pride and Prejudice','Set in Georgian-era England, this novel follows the romantic lives of the Bennet sisters and explores themes of social status, marriage, and gender roles.','275747382-4',441,'2022-10-11',15,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (6,'The Lord of the Rings','An epic fantasy novel set in the world of Middle-earth, where a hobbit named Frodo must journey to destroy the One Ring and save the world from the evil Sauron.','901074270-9',429,'2023-04-28',43,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (7,'The Handmaid''s Tale','A dystopian novel set in the future United States where a totalitarian regime has taken over and women are forced into sexual servitude as ''handmaids.''','562973903-4',424,'2023-03-31',32,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (8,'The Kite Runner','The story of Amir, a young boy from Afghanistan, and his journey of redemption after betraying his best friend Hassan during their childhood.','634695478-4',414,'2023-03-30',9,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (9,'One Hundred Years of Solitude','A magical realist novel that follows the Buendía family over seven generations in the fictional town of Macondo, exploring themes of history, memory, and isolation.','470847526-8',275,'2022-08-27',42,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (10,'The Girl with the Dragon Tattoo','A crime thriller novel that follows Mikael Blomkvist, a journalist, and Lisbeth Salander, a young hacker, as they investigate the disappearance of a wealthy businessman''s niece.','107351580-X',394,'2023-04-19',31,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (11,'The Immortal Life of Henrietta Lacks','The true story of a woman named Henrietta Lacks, whose cancer cells were taken without her knowledge in 1951 and have since been used for countless medical breakthroughs.','551663565-9',498,'2022-12-02',9,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (12,'Outliers','A study of successful people and the factors that contributed to their achievements, including cultural legacy, family background, and individual opportunity.','941629071-8',269,'2023-04-17',7,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (13,'The 7 Habits of Highly Effective People','A self-help book that outlines seven habits that successful people possess, including being proactive, beginning with the end in mind, and seeking first to understand.','351184143-7',246,'2023-04-26',20,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (14,'Quiet: The Power of Introverts in a World That Can''t Stop Talking','A book that explores the value of introverts in a society that often rewards extroverted traits, and provides insights on how introverts can thrive in their personal and professional lives.','793368680-X',381,'2022-08-21',50,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (15,'The New Jim Crow: Mass Incarceration in the Age of Colorblindness','An analysis of the American criminal justice system and its impact on communities of color, arguing that it has created a new system of racial control similar to the Jim Crow laws of the past.','681504275-8',188,'2022-10-02',3,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (16,'Sapiens: A Brief History of Humankind','A sweeping history of human evolution and the development of human societies, from the emergence of Homo sapiens in Africa to the present day.','101956364-8',263,'2022-07-06',10,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (17,'Bad Blood: Secrets and Lies in a Silicon Valley Startup','The true story of Theranos, a Silicon Valley startup that claimed to have revolutionized blood testing, but was actually perpetrating one of the biggest frauds in corporate history.','525380625-3',486,'2023-01-13',32,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (18,'Thinking, Fast and Slow','A book that explains the two systems of thought that drive the way we think and make decisions, and how biases and heuristics can lead to errors in judgment.','437100963-8',366,'2022-09-21',22,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (19,'The Emperor of All Maladies: A Biography of Cancer','A comprehensive history of cancer, from its first recorded instances in ancient Egypt to the latest developments in cancer research and treatment.','701627688-0',277,'2022-11-21',33,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (20,'Born a Crime: Stories from a South African Childhood','The memoir of comedian Trevor Noah, who grew up in South Africa during apartheid, and the challenges he faced as the child of a black mother and a white father.','383440054-8',150,'2022-08-19',39,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (21,'The Notebook','A love story that spans decades, following the relationship of Noah and Allie, who fall in love as teenagers and are reunited years later as adults.','427844252-1',375,'2023-04-13',6,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (22,'The Time Traveler''s Wife','A novel that explores the complicated relationship of Henry, a time traveler, and Clare, his wife who experiences their marriage in a linear fashion.','912099749-3',243,'2022-09-03',11,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (23,'Me Before You','A romance novel that tells the story of Louisa Clark, a young woman who becomes the caregiver for Will Traynor, a quadriplegic man who has lost his desire to live.','017716601-0',325,'2023-04-19',3,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (24,'The Bridges of Madison County','A novel that explores the brief, passionate affair between Robert Kincaid, a National Geographic photographer, and Francesca Johnson, a housewife in rural Iowa.','367828098-6',139,'2023-02-17',13,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (25,'The Fault in Our Stars','A young adult romance novel that follows the relationship of two teenagers, Hazel and Augustus, who meet at a cancer support group and fall in love.','776896807-7',118,'2022-12-23',28,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (26,'The Time Between','A novel that tells the story of Eleanor, a woman who inherits her estranged mother''s beach house and discovers a mysterious trunk that reveals secrets about her family''s past.','965774367-2',285,'2022-07-03',38,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (27,'The Rosie Project','A romantic comedy novel that follows the love story of Don Tillman, a socially awkward genetics professor, and Rosie Jarman, a young woman who enlists his help in finding her biological father.','250111759-X',433,'2022-06-29',13,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (28,'The Wedding Date','A contemporary romance novel that follows the relationship of Alexa Monroe, a successful lawyer, and Drew Nichols, a pediatric surgeon, who meet as strangers and decide to pretend to be a couple at a wedding.','252414089-X',497,'2023-05-03',40,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (29,'The Hating Game','A romantic comedy novel that follows the love-hate relationship of Lucy Hutton and Joshua Templeman, executive assistants who compete for the same promotion at a publishing company.','678174305-8',204,'2023-03-25',9,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (30,'The Da Vinci Code','A mystery thriller that follows symbologist Robert Langdon and cryptologist Sophie Neveu as they solve a series of clues left by the Grand Master of a secret society.','444342854-2',481,'2023-03-24',47,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (31,'Murder on the Orient Express','A classic murder mystery that follows detective Hercule Poirot as he investigates the murder of a wealthy American aboard the luxurious Orient Express train.','056490847-9',457,'2022-10-23',48,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (32,'The Silent Patient','A psychological thriller that follows psychotherapist Theo Faber as he tries to unravel the mystery behind his patient Alicia Berenson, who has been mute since she was accused of murdering her husband.','701150704-3',269,'2023-01-29',11,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (33,'Gone Girl','A novel that follows Nick Dunne as he tries to prove his innocence after his wife Amy disappears on their fifth wedding anniversary and he becomes the prime suspect in her disappearance.','993081454-X',191,'2023-02-19',25,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (34,'The Cuckoo''s Calling','A mystery novel that follows private investigator Cormoran Strike and his assistant Robin Ellacott as they investigate the death of supermodel Lula Landry, which was initially ruled a suicide.','913022239-7',272,'2022-11-10',14,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (35,'The Shadow of the Wind','A gothic mystery novel that follows Daniel Sempere as he tries to unravel the mystery behind a mysterious author named Julian Carax and a book he discovers in the Cemetery of Forgotten Books.','828226113-0',407,'2023-03-23',8,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (36,'In the Woods','A mystery novel that follows detective Rob Ryan and his partner Cassie Maddox as they investigate the murder of a twelve-year-old girl in the same woods where Rob suffered a traumatic event as a child.','362672378-X',244,'2023-02-02',46,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (37,'The Snowman','A thriller that follows detective Harry Hole as he investigates a series of murders committed by a serial killer who leaves a snowman at the scene of each crime.','876234150-2',399,'2022-08-17',26,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (38,'The No. 1 Ladies'' Detective Agency','A cozy mystery that follows Precious Ramotswe as she sets up the first female-owned detective agency in Botswana and solves a variety of cases with her wit and wisdom.','840755010-8',424,'2022-09-24',45,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (39,'The Girl on the Train','A psychological thriller about a woman who becomes entangled in the investigation of a missing person after witnessing something shocking during her daily commute.','557471559-7',189,'2022-11-08',3,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
INSERT INTO `book` VALUES (40,'The Silence of the Lambs','A psychological thriller about an FBI agent who enlists the help of a former cannibalistic serial killer to catch another serial killer on the loose.','574253901-0',118,'2022-08-24',15,'2023-05-10 05:12:04','2023-05-10 05:12:04',0);
