INSERT INTO `book` VALUES (159,'Let''s Explore Diabetes with Owls','In this collection of essays, David Sedaris tackles a wide range of topics with his trademark wit and humor. From his experiences traveling the world to his thoughts on modern society, this book is full of laugh-out-loud moments and poignant observations.','110058162-6',249,'2022-09-04',19,'2023-05-10 05:12:05','2023-05-10 05:12:05',0);
